import { ReactComponent as Check } from './check.svg';
import { ReactComponent as Delete } from './delete.svg';



function TodoIcon({ type }) {
    return (
        <span className={`Icon Icon-svg Icon-${type}`}
        >
            {type === 'check' && <Check />}
            {type === 'delete' && <Delete />}
            
        </span>
    );
}

export { TodoIcon };
